        public static IEnumerable<SelectListItem> GetCompensationType()
        {
            IList<SelectListItem> ProjectCompensation = new List<SelectListItem>();

            foreach (var item in db.ProjectCompensations.Select(p => p))
            {
                ProjectCompensation.Add(new SelectListItem() { Text = item.CompensationTypeText, Value = item.Id.ToString()});
            }

            return ProjectCompensation;
        }




        public static IEnumerable<SelectListItem> GetFullCategoryList()
        {
            List<SelectListItem> CatList = new List<SelectListItem>();

            foreach (var item in db.Categories.Select(p => new { p.Id, p.MainCatName }).ToList())
            {
                CatList.Add(new SelectListItem { Text = item.MainCatName, Value = item.Id.ToString() });
            }
            return CatList.OrderBy(p=> p.Text);
        }

        public static IEnumerable<SelectListItem> GetCategoryListByLetter(string letter)
        {
            List<SelectListItem> CatList = new List<SelectListItem>();

            foreach (var item in db.Categories.Select(p => new { p.Id, p.MainCatName }).Where(p=> p.MainCatName.ToLower().StartsWith(letter)).ToList())
            {
                CatList.Add(new SelectListItem { Text = item.MainCatName, Value = item.Id.ToString() });
            }
            return CatList.OrderBy(p => p.Text);
        }

